import "./Ownable.sol";

pragma solidity 0.7.0;

// SPDX-License-Identifier: UNLICENSED

contract People is Ownable {
    struct Person {
        uint256 id;
        string name;
        uint256 age;
        uint256 height;
        bool senior;
    }

    event personCreated(string name, bool senior);
    event personDeleted(string name, bool senior, address deletedBy);

    uint256 public balance;

    modifier costs(uint256 cost) {
        require(msg.value >= cost);
        _;
    }

    mapping(address => Person) private people;
    address[] private creators;

    function createPerson(
        string memory name,
        uint256 age,
        uint256 height
    ) public payable costs(1 ether) {
        require(age < 150, "Age needs to be below 150");
        require(msg.value >= 1 ether);
        balance += msg.value;

        //This creates a person
        Person memory newPerson;
        newPerson.name = name;
        newPerson.age = age;
        newPerson.height = height;

        if (age >= 65) {
            newPerson.senior = true;
        } else {
            newPerson.senior = false;
        }

        insertPerson(newPerson);
        creators.push(msg.sender);

        assert(
            keccak256(
                abi.encodePacked(
                    people[msg.sender].name,
                    people[msg.sender].age,
                    people[msg.sender].height,
                    people[msg.sender].senior
                )
            ) ==
                keccak256(
                    abi.encodePacked(
                        newPerson.name,
                        newPerson.age,
                        newPerson.height,
                        newPerson.senior
                    )
                )
        );
        emit personCreated(newPerson.name, newPerson.senior);
    }

    function insertPerson(Person memory newPerson) private {
        address creator = msg.sender;
        people[creator] = newPerson;
    }

    function getPerson()
        public
        view
        returns (
            string memory name,
            uint256 age,
            uint256 height,
            bool senior
        )
    {
        address creator = msg.sender;
        return (
            people[creator].name,
            people[creator].age,
            people[creator].height,
            people[creator].senior
        );
    }

    function deletePerson(address creator) public onlyOwner {
        string memory name = people[creator].name;
        bool senior = people[creator].senior;

        delete people[creator];
        assert(people[creator].age == 0);
        emit personDeleted(name, senior, owner);
    }

    function getCreator(uint256 index) public view onlyOwner returns (address) {
        return creators[index];
    }

    function withdrawAll() public onlyOwner returns (uint256) {
        uint256 toTransfer = balance;
        balance = 0;
        msg.sender.transfer(toTransfer);
        return toTransfer;
    }
}
